import React from 'react';
import { useDrag } from 'react-dnd';

const Subject = ({ subject }) => {
  const [{ isDragging }, drag] = useDrag({
    type: 'SUBJECT',
    item: { name: subject },
    collect: (monitor) => ({
      isDragging: !!monitor.isDragging(),
    }),
  });

  return (
    <div
      ref={drag}
      style={{
        opacity: isDragging ? 0.5 : 1,
        cursor: 'move',
      }}
    >
      {subject}
    </div>
  );
};

export default Subject;
